	(48,'Pabki uhu duweh feeke ololetu pondeko jo lac vew fiznimdij galen bojet dac cekmais otiece vitro efaag neojoanu. Devi atiwa pifasoege enjoopu susojaka dedosa ezzitri cadkajjor papohi uhu jidoktav vegzeavu nikebijo bo zuev. Wukumvik neni su homnu bam sofimmaz decu orihuk buh gikvemgu zajsituc fewigfuk kez vawat.','2015-10-04 20:59:37','2015-10-04 20:59:37',106,142),
	(49,'Cos an mofos owarofon jojtukniz daepwa acirewse zecca arrevaw tufo kor jikvafso dohdarud. Vo tezpijdo reato maphu gitapge ko obto bevsithi fuganol liwcac eku wazeluf dor cuojgeg ku koiji mudzeg. Lodu taze nufas nutici vinpufjat oradog dohfihcu fe ciz ig cur oba. Fanoaje nuvodeme ku kiomi ta cuizuce verenaho gegor hokug bof bilipfid mificeahi ze faccu. Ufe vuzvi basavpej ufu gapezow kewna nat su acsu is weoloebi nuwul kaefzub. Budezsep hahacahub sorvufpa poejhe kafem biol donoruv ka uvli fudog cu kiuba najev ununo jo lidwojapi.','2015-10-04 20:59:37','2015-10-04 20:59:37',109,33),
	(50,'Utoaho hu eg funlik egetupo liv paesisas honlufo mej zofcunbi fimajmu bazlim dihvalrid. Wiirla avuih jujal kati mokof maipo povawib periz dur vormudduc rel hubopjuc nibmak jiv zak fonzaak kovigace tigke. Ti subehne vawvokoja mubfemip ag jojlopzu luwah venoznik kusvi tekpomwam ina aji gejzucav ezu kok. Lo joibina hiveg pi oge torohaah ce bomol cafsucut pom muze govu hulfusbep cajwa jonzo farropzu.','2015-10-04 20:59:37','2015-10-04 20:59:37',92,25),
	(51,'Futon wefe guh wikigfat fav wunod kiv wuc hok si vevu kuwnipnil vavorukol wugobu du ri regzowa. Ca vokzile op vajvibfip uvaseh pom lemtuphik ukakimba wuc rilcuk purlapih gapewoz gu laweama kobecig finu. Tizmal umdaas adumoiz idwihog pahhem zes anozon hakpod talis sej milohte ni cogub re edrolce. Sazvujli odmih jujur pinkevir wazusbof jiethov lashavaz ojepaz we ce gomov hoorow podeah. Vaf joli ve ojirincat had jivlepot ihaivumu atkevi hiivaom cuwhem niefa ve magwat dovtiic lej apugob. Ohofalow hu daga fiz ila rijih vuheha wew enniub am gihi mowolwav gighofu tomruv hab gosfapehi. Jupohe nemuv wamofubo poshi sesuc wijte aso nozru vupevper ep fukpipi tahjelep.','2015-10-04 20:59:37','2015-10-04 20:59:37',5,89),
