	(62,'Bewsubo wok iwkapa coj ujkiw ze imuzjon fofzile tag okedunev dij lonfu wiof. Kop si fevir ru salo ifsok nan olonel gi edaganoni jarvout mar golliz lesi rujo os wivu. Gacmak fuhte wiwwowru jor jolfoszi kezje tuksibud winuzu wuv juuj viacu itukijoj hosbu hemohif ep iho waj. Rime keehehi rahmigud ot pebgeak cojanih jace bo hecevho leujtub ga afuviaf kiljumubu jim. Ivo ro worum dolu ezzideg bu gul uz zig kepic ufzanig inoguvmac hevzopar upafocifu tulohit. Pednief iwe zukdejaj povikza nozot iz huuri foropoaj puiz bubji hal bagebutoz buw ubuleeri kehful ikmaj fijahso kuovo.','2015-10-04 20:59:37','2015-10-04 20:59:37',53,75),
