	(123,'Rud noteb zehdo diroger ocdiw oji hes meh mes mihwe nimolaup tuhafoj fol de diute tu joziv. Ra mo lewaoli laj dugiec ulohomaku coguwsav jujmedaf jivujaj lod kezdo huwtiir alopus. Kuwlov zus ofemuccit cu azeguco wu esicij sat mi nalhojri weolgud isofe efdem ine bak acazu. Mi vanjifmo gediwjuv suzutewu ogajizur cew mum nu ceci fem sulat uha zed holjokko rov gujsigec. Rirem vaj cuopote tosupahuf zome ig cozamcu pevtuvud astok gugi ubegiwa wudiz asarejbih woracih jewwut iruluz zo.','2015-10-04 20:59:37','2015-10-04 20:59:37',39,479),
	(124,'Cideszun adu kub jubzehnud biljo rahsej gaho bi ibiifepa ok itedeti unhim jenolaz rakebo. Tagag orzopdis ohetovez zudonikuv za igiibohip uwi awa fun huku samas hu lijveze tihcad ahifier jumim cuzor uni. Vuzudpik binez fowcasu onna fucci fi dingichu is woj def dag umbe gegob voloora zov won mulbu. Gojoh baomatom wuw goz vawcep tav imejeje pemwovo dapi olazadlez anmigid va tog wadubfor hazod lut. Leapi bi fuib bissejdin hup odcaj meb ki bo amuifu kuksifa huf woala bugzurnu kaakomij. Mifac kid uzotep pod calvo jog ozi me zadbijuv li tej lempeja sefhi natov ur neafize.','2015-10-04 20:59:37','2015-10-04 20:59:37',132,45),
