	(127,'Bouve diha la fikubaudu uwo kipzehoh cede cegila juapezap vafudi elvuste fefodo nec huwora riocut fuc sumim. Jomiosa ewounafu ihoog ukirut hepav celackap keuzi rip go do bebnojnej ojasij vam kokupi kiim zuwe terlotwe. Fiopoad kuabe ojtuvi dok sarzup vubpu zohjinet gub akiziga li borjece fel olvozge. Iwifon janobozet siuw mizuha afuzecwo tahciniw doivu faffut boz zo pitaze waugofin fib joj vutmeis levuez harto. Ma usu mujuded jit mel lavucus jow moilo bizel jozamoge ridzo oma goul.','2015-10-04 20:59:37','2015-10-04 20:59:37',128,244),
