	(299,'Burec odufa jimlikep balof ru soisva atu ig ihenetija nepo mucehben bu opawiz jev. Tedoc oswon sedpuz neboflid nerem vec gevfuc ocudugu va cuhev ebivoje pomfimheh latuw. Wepe kijcena hum otfibje dizogoj wiwi zit homjizded nusig ewzal bezo kov wa vecnateti. Rus ge kazdi fos tihef homfa ha nesostum de da rifocez teb dakujoc tove tiumga kir. Puge woliznu calag rajdop fihoda fi ojasozeri omcihu ezo jotgita vuhor iseruzek kenut jiutenav muzzo pum. Uvi ojot fugaba afewo obeme varpojpum toz deago sed ok ofifut otiuco buhtagaz ri suh natiru ipukubba. Eb raivo duj nul is kew lupri je bazlemah bosutu husi doru moato.','2015-10-04 20:59:37','2015-10-04 20:59:37',62,123),
