INSERT INTO `orgs` (`id`, `type`, `name`, `shortname`, `email`, `phone`, `fax`, `website`, `influence`, `img`, `people`, `about`, `video`, `channel`, `contact`, `createdAt`, `updatedAt`)
VALUES
	(1,'government','Kurfi rodi luwikitud fotsib ro poke lahi','vuvat','lelos@cotbujhah.net','(834) 716-4898','(874) 436-1016','jukuvdi.gov',87,'/assets/organizations/4.jpg',6315,'Vit rucoziode marubu nezbis dah lagbo rauc opzof dosos zomewil uma fukruzah. Vazde mutar hawaw dignur do gesag vi ratbofa sacjav lagtibsa jiv muwziasi laojuhu wopav fepcuw. Ri ni tuf ho bewca kiizaicu ilo leikicog usjuk dobupit zivov kashojpun cotupko. Es kusfumeb ju ir dijjacho nokhu gupub sitoj ko itwat zo lota.','http://gor.gov/sakoaja','http://ome.org/kezmub','Ta rabe pi ruozupe awo wizip jilab wukmidude hijetuh kojdorhe gidesluz zisemij hicetto hajgu mi pu dohnok. Paha da zocsopvef nov eru evalaz som hugor sefu kup wojetkut vikdas ud. Ace lobete buhom gawejag kodzisu tafpogil uwuzufre to ik li sevlusgu magezarez rokehfi. Bicegsu run vongasta bamarad fa genru el cuvuctus jafowzu tinob obe birmo. Haj fa dulse rorude ruv kidtol etuis raspimof ihakuti uluuruuta geti sauni ot jezab. Gali ak ko ed pogero mozuposec tahubire tilveh fewre ziomzo or lettigti zorzijfo.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(2,'company','Cutpa kugluvvew murilme ufgugel vogcadmu','wol','pocri@hur.co.uk','(951) 628-2301','(273) 347-6551','zeho.org',41,'/assets/organizations/4.jpg',8931,'Aleeswaz rewine lizo jad milgocis ewaiz mecev tocton kojiz ig omuwi reblobi. Ovha siehizuz pazun ficamne cunevake hupuugu de les ho su kivuru cemsu jiamvic ci wog ti juvud. Sahima ehtem juj em kezfapawu ekero asfun we lohug relar olapu jic rujircod alezibuna uwipek edmapcob. Comeg maz jocsuz sajezuz bibmal ret zarwi ba rul du tapes etoki jaganuf no kooduija sidtag gerina dili. Gonbof obawufiw corongef zapo udjuuni omeziv bitnan se tin wuwedap zanzecbig ha befuh.','http://wujadi.edu/dow','http://wockosa.net/nav','Nak juze okli idtenrac hugfodlus reile tashiksa uc kugwofmi donoha nazmiodo jesam mihfer zu seme awvuf. Weceb fipbum jafzetew safokmop guve ravevifab tet ahmutul nus bugfa rurvaz feiw nuned hatgoro jugani. Fobso vus kibsupam vudis ne bep towag taucnar feironi hahop jazdag vaggeblol vo ebabe imogovgul pug.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(3,'group','Koefala abfemo sisihgef asa ves moffanpa','mav','lavaj@ze.net','(577) 208-5451','(373) 533-8734','ujiwo.io',18,'/assets/organizations/2.jpg',8417,'Mi bijre wedi udolalbom dotze fugave cesuv peduknoc jirfip fafasi saj hov eni sozwegi dada podege mulhep. Iggu zi udones suuw utapi re zagfav duwa bufofko onid mocapew hazeki vidkure todog azvuvkit keezaika. Relpu uhogi iw erju use ruv ikojukoto nusoluc tog sugor we zifciv ukoki nopuj gi hesa.','http://os.com/gop','http://seccefigu.org/at','Ipdikab vel podeni en opi eliiza podgu fuhe asdu mab ujoike ta. Optuhcub nuju fepvozaf fobo dihdirlif od dal wagte feukre hiksu sa pag nut gihifgem wim rihuava wamolmat ziavameg. Jiri ahsenok fez kudfo ne wom dir oza ena kilo tac pucov rit ihvuptat zaber ahefosi woinu. Ceufi bipaf ki uwugezcu lovlijro fojba hawenfa eviwehe rar ma co hilipib.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
