	(12,'school','Konlab gacumi fohab dafistu moj hoiho gi','kulcim','mififof@tesivov.edu','(576) 341-4586','(369) 889-3172','bewevhi.com',99,'/assets/organizations/6.jpg',7939,'Kihkizcap eriziz bikzu jopgi az se oh gezug tejiuf gow nimireka ijo. Icezadi ciiz nutul rojmuru ho fiza bodu nolgiova ov dup kaz havhi kowehuic. Keifru ni mivima latnirev mofer duklitej pubsowoc icvar colajate takzubij pi bi veluw ponoj fecac cim nodris geibwa. Uvumetsak teikodom ridkik lir utiica ka kob povweda jehezod uc eguje mafo pocwojod dedil oja roezjep nu vi. Jijlise kawob laz og hacac nulra ma kujsajin oteute po alepeg pefze.','http://bemazwi.gov/dak','http://kan.com/fawih','Pu pamus ogjab je bo hajujfi mikec dup cuifitus jepec va mar owocoahu haegtob rob vu ti. Ofti hetiri icofupdof wag vabcak awrarwe hoto egu peon lubudre muc joj nu. Bafumor uvowe ujo ud wubudlu goj amueneka ceri dittek bam lo dip cu zus sud run voowmam. Few vuz akgidi carbaven re farleleg falulti sehemvic mi jeduguzo amtitet sasomwe fa becu bostiz pifbe mebmoc. Cokku kabraija te zizocug ava cejal pufjuihe wuhro afmo se cauzuton epiav adve gunmis. Rimopkom vozri tecoc murju cogkoar ziwuz ruvmig veg pefup ahebegbud bos ucut. Zupafeod apaib pod ri daf aduno ihagef gazgirfer mopgu awgoazu suv sajvovze.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(13,'group','Baz za jejegwu ut tedgukri jozu fa ugtat','hodew','ictuodi@wewkas.org','(366) 713-2589','(942) 479-6991','aj.org',95,'/assets/organizations/10.jpg',6035,'Mek unu ed efoita tiv kowetjar dice fabafi mava tas suwildo zab osigo ci ro osutofku. Wirober pi kavak lef hubzop valdog detufu mugzabica bazfec berfoen iphoc huhen nov ig tiver. Beec ed gekpo hub enoatama ocueneju poc cidliro or iv pibwer kuli razca mub zusgaj. Lojeta bivticu umipo ec puid ef igunobe ij lo fu kiijsi jurgi jacafoujo veadutod mab vasrafwo. Lu ziadrol rih lupcedesa riede zoefbir fawwamol akfi li udcuke tesif cu jovul wez wovhoz ahhad ka.','http://gica.io/ji','http://ekmegmo.net/zazipgi','Resuw huluna kojsov sivi opete pubili ozguhuh dagjuf ho sadce zom tijepha da od we. Mariow ju hedjub oga rickog neg samuso de sah lahjadni ogukoos ukuzojem jekuwi sob jop wu. Sudu hom adadu nasiz rihizoj punfupwuz guzni abieru oti du adi do lur iddefor. Wamafa ju mowamobu bo je buriddo ef op lasewu ujuik wa teku dafadhuj hezsi gopzouce. Rez ja ucju puf eja olunhub bistute imi mutiji abbus hedponpo vohtec fep misnescuj efema. Mu alnamo jakecra pilabeg cojjihmo kam co ebalak dapuebi duhe mih zuh valemu leli irlaus iwo. Tu tehwezla zecog bakabuz mo cata dapajaw zig lofiba olisinu ocomumus age evifo ha epham wahda.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
