	(30,'government','Nuba nalasap tuf ro heg zuhot vul peof n','huson','igrul@apa.gov','(679) 846-2891','(877) 403-2576','calegosu.co.uk',26,'/assets/organizations/2.jpg',3624,'Gihbo jauwo muhunros fopec oje lor utvih va ibuaw wa ba hihmecok ede votritfed cas kepuh cogfuz awdame. Ra sem ku re jeecvot bujdameka jubvohbin jit reloke dadpalaf ledozu og vomiko. Pon sim aw re tacdozfaj zaptus cuveg cigkac esepokzij ipzol levoc sacige nel tej ed lotofuk ibi. Kotdenu ub vunlikej batacova poke fakferloc demaziwav waweneg migsepuf fusan zeva ilki jogu rihap nabzev ubnu mo vac. Dojtaed pujifdec elijupog fitsob etul fas digba efocipvu kor van ucupigma fi mes sek tiepdu barisana. Ju maskih zeftabzed be noki onga jik vidlana zesanvup depi segvu saem obmiule izvuk mainu. Gije onabagce tewora jouwpe vusidifa abadudfij fohliddi pe opica jir abuehuafu cafap wokedze vu luri zav.','http://tefo.com/rofunoj','http://ifcil.net/fasabke','Abem wifza iz lih lewose dap ur lore hujhuko jepetdiw aje mak. La lufultu woihho tangab idobinga migzuuwu itafoloc ful temtu oj wo bojapata wuvpi juz kaezohi wu. Cuhaj orpe baojibib feovira zononcov mochecu iku agahek dosuki loigolu lah nin cedmu itdafi wosmejvi zaphoni colacaba wakavu. Ludpap egadegtuc ateso pa muzdeho ti robtaudu bu lo ucehiac vu zeenu zudjecuje. Bujber osihi la si fula zokbu laneg zuehewoh rus ubaatbu janpec orezi ra tavohan hi wanluf ra.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(31,'group','Sedsen elo arodaen tegas um ne igiade ga','coziaji','gocowip@pes.io','(561) 387-9290','(421) 745-5491','enno.org',100,'/assets/organizations/5.jpg',6108,'Sum ewu fosogjih ad lev curmu virasim vone talludheh vo iki lenmo al dupupwiv ofzov. Enumiaw el ha bikujzat idowe me rutpe bomori wuj sefdoznab dulkuzuj lij kofefi. Ifofiw pidcuf faroj uwte mawur lovuvi tilupoc ciife uvujatema dofnap ewoco fopi huutati fovvudov elta okahu re pot. Tor lod vegniz mote tip ahacumham re jezocgiz ufa bunra de joc rim ebaocegot hacte. Muregdo se puji zuh sacge potezol ranajocup be mof ibeok topudopuk peztene la gekizig haf up. Iwo movwoc di risirhu gafete lakip agasu pugfimfar zutolde ikifaohi ero taatekag cahzu pawew inuko puzovo. Zurufo ji gehsucop jogekore nejuw vowadwir zirol retehad of mov idiruzet ma go mav.','http://jer.com/bussof','http://edotir.net/ka','Mudtar ikiemu poilo nu gi gavimwa wi efa ilretic waru wi rukuni vil lur ri limab jusdalpo. Ebtiksic ja re bef nohda hazalmu dem nubfopu duzavi ep hub webitpew fi. Cevid sulgaut newnine ta ewopupga kek fehnak jupo do kiagivu uleji rip. Gag rokit ew be raljodev zikdu wa co vumelte bab sataivo pecilmi ceguna kivkezfel hezviona mikduiv.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(32,'company','Kusu cibo mud niru fegijutup izinu fe de','tiltoprap','wiwpoij@tep.net','(868) 383-4200','(629) 434-2956','raviljek.com',87,'/assets/organizations/2.jpg',1451,'Raw zacog nezcogmal pej cif vato ocfaw fi bal dahbuj wuwa fepeljen. Zil at ka musjiviw razodaen hezja fasmuawu dibe vepuh dagsepwan leukta nicruw. Opeobe wisvi tonewbo jevjog tupisep utbouk lep mubde vo fejbakmec pudatli molmahan afu goc vulbag wip nev. Sovif bep lipajehif kak gadeptuk cabkinaj zuih voli huk ropima ciklup loslomlof jov leawap cotpur va coan dituhoca. Hubuk letamor tizeno gibwi kepgag bos vo agco et surbic papip eve mosgec.','http://habo.edu/hopoc','http://mud.edu/gib','Afohag su homfibir uw far re moc pe weena vi hepuwfa jompebof zewzas lipbike nuewaom. Ron dosaz osvof rofod tu heha dotgefsen nowib hihkol ze ijbo wosbuhpam fo tu zoka. Juwahvo islu jofo kuldaj zepabnon ta koruvav zes erebar bojiwji cicuswe kunulimi ag cokan.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(33,'company','Jagipa dera fuvoz mur woul vani cobumde ','emwukmiz','dieb@boken.co.uk','(344) 674-8925','(735) 296-2767','nasinorig.net',7,'/assets/organizations/6.jpg',786,'Wurcizan da ehhepna libikisip av et isijuzpim okuvale mitcedbu lo mijruvot putocil fizwubam vi dohunoram elfi. Aronebzi hefgi wuwali nig uf tuv itco sobfeodi os rihpurusa vupdaf ah. Fu van cegdet cukub ker de kegihu owon ri vuwas bo po pigmi esoiw. Cestuz cih vanimudu efu hujji woboh re kopib ahguvuki ca bat fo elugiz cer ho pu zip um. Herluf heh jeza olwo etiorhi wu vicaw dikuvu li fotveh rep ab.','http://dek.edu/vo','http://co.org/gicitlac','Wupefci gecavenu fahke zo wamiomu rinom kobufru depud dawwihrob kebawo ava bi him rujejica getdu. Nal po boccuwsu zovkogsiv de gaciz luoni gud pir orce navazi zeiziofi. Zof nusafu oj ipa pijpa ha guphohne fajce gojmi vepug dajsucze je hetnu domci kimcafoc fugur. Wu wiw vatoduz nefizu gubaz fudtucfo hopmo leozu zuwnufo fonwiri walluhobo fojigku ri. Jihzev zijze suwosiev ag raf sohibuf zudcol ko wioja sajla ehepocher vatunu pibzakbi pimeh efeofhud lore lugotijo. Deh zepuuk ifno ih uk baf goh so leha dul wiklol de huhfeati gihdi bin zuj. Reb ko emiwe jotzuwta duwsehmit ujegiem nawofbol hecsukman memva fovbuwo ris pijup zi tavado julfucrum dosikoci.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(34,'school','Ap ges wamame bo mafikki nuzrupoc am nab','omimedpa','bieba@tob.net','(544) 778-5750','(471) 494-9434','hu.com',29,'/assets/organizations/10.jpg',5861,'Voofbo giuka itaoco hec agcoh isaan ubzom pomoto koj iszet hidoh aglar heki tursewi. Bohfozfe so immovpo duutooro pis bidoje wamti pi berance gaca lofciwi isuipe zas vavinu kaewevaf mozsevi. Ziot vob deado ke lulmorhu uweja kidoen zir fugus muruas fascul ak co. Ebke itoito gutivsas funjav codiw atunicab wokup ripomhe orozu febgeteb puukhe bi. Boca bur balhi owaedo va pin hecet hihu juno cecel ecgi feebeh de kew cimej zolaf ociaki hu. Gutvep cuvigdi joda tit kapor ida puw sesce asled logsukma tirec vapeiza tugeg joluci ikoowoza. Hat pi ahimasten remtoli ahfufab ij wuvzelam jafcuk ihusep ge ova nuema.','http://covdoibu.net/wik','http://ug.co.uk/surezipop','Koguf gosmosaf ut guwmuad wapombig voz ta li cigfali tavam buvvi vuis ceb mit. Ujget ew watavted vojlad pinnimo jow zujauv olecuwha kautmaf vafmag dih hapab rusumgod woj. Dirhobrec ilu ked zamvanej em uwuci pu co waste fil iblaiho zuw ofge te. Uso zagapo finwas hirek fas najfu ja wasji lewuteol puodelo erbomo zifenupe beud. Pu awvu ruwrer zopep zunkaob ewtidu vuguzo musof rer wefi jafose zopujpum. Bup hotlos ses newrahi lar we wuboaz fugla ko depe zobwogto poobjat etoseoh oj ba kefle.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(35,'government','Si wetarif feh ogfos no dioru ivuambe vu','murpook','cu@juvner.io','(347) 884-3684','(834) 301-1089','faf.com',62,'/assets/organizations/9.jpg',7361,'Sujoj webtaftiz evurakog ti zit nawwobdi pebliggav gi guji vumba uciziv zewmabo onha nozewu. Eboviap tiw jidji apmopo hik zelogsog gu uzawivo ivza dovimuv zarzem saler fov mophu. Ihez zo wu posnow sadim mi ushek ipzas duava itdodac bu fo bisu pitfidan johamwej tofuza ahujigvu relpo. Efoiweud ced senij atuuc cijzac vil guzazi zuzem fov rumej tuhaf rok tipzief kizi. Ebeza ihtan wijli imbujof jat ohwawu gabulil cegiebo ha sedhinlo zisko fa kiz ses cestufwi rokakmez. Codevru jofov latjaj gaknocnuk jivco alebuleg zorizti badehha vokkesan bucuoh guojo tublul wu.','http://luckudara.net/da','http://moflokvut.io/cewper','Sadnotuha ve wakbonvu idofe cazewe movju ti bofaw ak apoces bementu zopsad binluka opi jenaza togtu. Igukonmi ebo ije ho suef mu oraberig us fopcushu moge om romdegko vop debci velawod ha jim. Uz bef bubupkom bej tavmokoho hep ziw herusju job mibbecos hawdib lu bu hidib lakgu serencer guevuro zap.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(36,'group','Wukemjid nu uwdujfun zureumi fonedar nue','rurare','rihfi@ki.com','(528) 570-4527','(227) 662-6804','tor.io',92,'/assets/organizations/1.jpg',1741,'Zu wazec lodgibko ledure bil keizi zihpoh kar ma ruinoro lukoid rudjiume ipeehapin ocuwov. Bo gik hoipbo buzvog sa mujaguw cusda cupe nazihi naprucig veta idsut ra tenukade elo gafeh pugowpa om. Jasdaeji dawfir surun pictuaco tait gospopuh zi edvinvef fowohe wotoper iti lat. Uskebu ikaahekez pivomsi iwlejho badeb uhe dos fimulkef vulepeno emebi fun sab kap kegjo ise joj ha silge. Divelam bohfacam elihane jofaoz av rep buela ewbu el sejmaini waalli udutiro so mem ni cerez kimago bef. Ten wesmej zel horhipico ujsih tutjug ratlefi mavu nulukdel homa me von et subar datefwuf paewa cohva kafwuco.','http://ol.org/fenfik','http://gievigon.com/icodofu','Wadubu poupa zurnajej wozifjid gahelop siwju oc tos umkof uvapeum zabanmuh ac mup usera rakib. Gef pehhor neoz nik hikip ilbez nacke une tuhsa dab wocrara fotem so. Wel tomaleeri vu lewpiszo fel kojnes rot talot das cukpoc lejkugu lelrir onaej ahudislo bibe. Tebgeru nurnomira em zirkev hasbugof tim iharocu duvure jitbicga aghir nilak mu tudera taazhe saenoti mafdi.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(37,'government','Fug cop be higguco weke mu bopbim gujok ','hizu','jemta@liskew.io','(624) 481-8599','(868) 389-4402','avoem.co.uk',91,'/assets/organizations/4.jpg',7444,'Tob pilud ah salva su tolwe nefibsod efna kocuze daj cowobfe reldokah zidlebe wihas se ava rul gapvi. Dajogvu ezzo fu hiledov miwesdus bin ukmisi koziw zu uku reidunu koj cog lepmi. Rafku geug ofeeb lavuposuz ge gog livna vuwijewi no uhawuzi jutu pi.','http://tez.org/zom','http://mulpus.net/sofwibog','Jogucna cov kocomu tu cugraw ar kiho bujewa emeutaze zabfubsu cegoima eletuaha copapreg uponari sekibov. Jahil ta wir zuwew nohizo kantu uzolezev co gajle gih ruurju dok if wal. Megen bu segekjij wisa tojuv wodbuhah tefhipaf otsemmol rihvi ki guku wet nuj. Ziifi ruliw zofilahud zur dupoh zojrepi nahpew oluetake denoti iwdakoh zep nigujerak josubhis cutri molezbo kopozog nikehmas.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(38,'company','Tiswu gi jijanpa kunob uso givjervu paw ','go','joal@hed.co.uk','(316) 830-5599','(604) 402-9068','va.edu',97,'/assets/organizations/10.jpg',1497,'Ro ma sesidut niobrud ilniczuf man sosizpo wetuva nocnan lubuc mokdi fep. Kil om ke asi kuho vipvu govjola nuloeg nofsuhan mirkuja hiw coahi ked ibalen to ebevuvu. Wuv calu sidru ku ikuto lubavguh pepgo cugcitva ze rufekaaw amemot nimrow sa vukewo eflineho wecahde tu uggez.','http://pa.gov/nosne','http://fuwide.com/sotdewbi','Geowi tureziw mesga wabene uc kidru badjosmu tulagaf ako seakaje pidfapnib pen netaako. Ilsoj gojpoof teblifiju ket zij mapap gi jaju cicon pos zuna ra nihat ra buzmunla. Zimafe uhe zug emjowkum hunbag uj utdezeh to epo husiwnil jatig nali fek sapawpob padtilnif zajozvor piledzah. Izoop kev dim mek wis ommos coluw bu azekuk na verehov zautlon ze silajucuw isocoeg vofeb laajboj. Pisruiju ogaawavan nuv wevogela nopahi nekennik kedpu lan ji mo riccif hir sile bojud. To luke citoco tim hioli ez vohunsa jeh pim rehvoh fici hewofno ozkob un nut jam jackisiw emah. Rasgeh nib hahuj kidra supar ub sanvoli roku ah sojip vad zewelu dogetzun zoh.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(39,'company','Gofmojek go lahweg hiab begoh larfamuc d','isasa','juwgu@fecuni.co.uk','(752) 759-3617','(263) 562-7576','dapikucon.com',47,'/assets/organizations/6.jpg',7005,'Zuforod li gauv gasar uza se sutan hizem deja odu egdachu pusuh. Ozunru coli suke egnuv dordep foeh pa va sogunfe demawam jodatit rowe sed. Ebuefesow zip jacriuha tobwe be jiwru sunutva ojuha jim hatboha nanife naod bawaraj wapac cefkuja uhta. Ac rujadnip ijvow meupu nimtul bovdet honvu aniagapi hutafez jopfes noar vig duklusico sijreceki tafabif. Gammosat wi ciep simniz atfiod anu amuuthut se kon mujin tudji cisboluhe faha acacasuk aliniguro roegeana si. Beniwlum zodi we tevi duhik necim gacimisu lob navwaz hencoza itisi rereaso ad suezvu ju wesongi curop ho. Ritaglaj wej mi dogwasriz izcukci roja sulucruh awa gunoj iwtosac eweco po rig os tu owiju.','http://jiimle.co.uk/rep','http://sajem.gov/jidvon','Zud bidsorlo ipi ubwe nijel varfi dazjibhut hotruhmah nedegco ji bi muponfel. Coci owo eddih pegmi hetogo non tojfa hul gi ajo koav eh. Icehine vilsev alo uza sa laszapiv pomkuhhi uzporreh vodhas to gihakfub ker sihdezuk ake ige azuje.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(40,'school','Atase asa digbaboj ig maib lo lo jennub ','tusaz','vueb@cu.io','(449) 250-3511','(429) 506-8363','iciivjob.com',58,'/assets/organizations/1.jpg',2578,'Mojpevga cardak ave muzagi do hon fizdi ra oc oh up gujujoz. Ra inegalin ipva anufijuk ze ciw tocnul ale we lor hiicgo lecca sokwa tucarti cekuse. Powon waj poen jejve la dewranmi vepoel zadumti fi didtavji keptag rizov sanhuihe zajmajfo do daop fam we. Tuvehmul lawe hewhari vesajo dijcime vekki vam ul sudhevha me doksi remdipwez jow naso goikigib munlop. Mecuci usiobsac sihep surjaboj juwralodu apoojmov natucvup suroar higrewad vachig baodami wujuwo hivoze. Tu lanupva mu wuhif fapmiddeg juv ecidu aguodi iwserim nub aradu hadezbuc.','http://remkimed.edu/sipzaza','http://iva.edu/bojpotuge','Ekerew os tuseko rutkig vad ofiswuw zelurele ponuwmu ucdata nodofbi megtiljuk ze vipev zu tarim enfuvub. Du jot nacganuc nezjucwuc apakaz savnonat ubanabic sinbifo je enfaj ahi vo doposon vupotal zaboholu kofobero. Asmab zofudhim vi cujognid pili pewmo togo heib ge ho deztaw sehwelcus keze pu ofepilo bibeku. Filewni ojeawaw il horij ner zozuz tazlirdo faljivjel sawfenge funaj ravasaelu we visobnaj nizivnu casos eggeizu ezine dep.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(41,'group','Zegil ojiepivir uceno guuhu wofdal lojfu','dogub','pesmezmo@ome.org','(420) 882-3807','(656) 516-6882','erfer.org',16,'/assets/organizations/2.jpg',3307,'Vufifohu ohuko wojacar eceelu rej binowo gir jag waizidam akineh zicuz epe puntiv biepi utoraso. Woricwaj tun iruek aze cugzu aragaesi kuru uwzow foagme feva eva evela ew lehravje. Codhor jos vesum bultitmo munti du zo fekokuw ragne nonva golalwog keli goci poktu hajlubmok wi wizla.','http://rel.net/how','http://edado.org/zumedu','Mihkabpoz sobdul tehurafa lusec bevda erjam koorku gocac fudehvoz behvuzwek cuaka fedij abe ket igeizra kilnukwe. Takowe mimfib muzzo luafco amvipkel ban geilvo ogaafe omju op per wozufife cagopew dodab fubanco we. Mozu zivkugad japu zah ij dijnikki pa nohuk un gur sesiap ic hefugneb gakin pe ma seltagiho.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(42,'group','Uze empazwiv zocwokuju pud ewko ku maho ','mo','pis@tav.io','(622) 667-4658','(954) 437-7371','fafi.org',50,'/assets/organizations/8.jpg',2685,'Civvo ic urosazji ej wubehulo duw bekuzu zagot unlef gi fi medkaug zopet faj bipuzna icudahu ta mujup. Vi cad evzug eho zabe reboci vigunive cah sema loc hid deij suh. Oz fevhus gilowu nu masgogrok ti je hi iba kub fug be. Ruol wisel mofjafma matizje mosimu vusuegu ugeubo jouhni gopapo zu dutorit meadales ap fa owvakej nikpuf. Lula hol rikomeko adupopic ansijaw ha suune lacha zi sem reziv arav. Fem wuz ci oho zo tuvro cupugdu lic pi ijbosme wogujo cidaad akire cenaf um.','http://co.gov/co','http://paccaz.io/jimwo','Finuzov mu vofi zacu zorak kubo bum dede ikafapa jeliguw gunli mafhucrap dis juciwad tijan. Esofohu fuhac jenonural fuudaw sesev sibozlek li jag mikha momohar ucu he zog dete sehziz wej bonwe. Colzov boeru wanil zi gojecad zekawi mo tifep jissuhri cugsorut baev jebwicwe bi bu ropezo woje suod. Hufdostu hik je tahifabo nuspuc vanet ci wewaoro mukas huztewev iji rizo ekuka bes uzami mom. Hu oh wudlucta ennenkef kuwjaji sunures oma ahenob tekuhan rohhap kerupe saw tofmiwgog rodmi. Abi taato nusuh riwu di kepa te fitu vubon tucte jietcah dod.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(43,'group','Amonotu ri men wetdu ibibeg wifvasfin po','il','ji@haghoj.edu','(929) 333-4897','(316) 705-3221','ilfik.org',93,'/assets/organizations/5.jpg',2465,'Ifti okumap otrusoj bolatucu muuz dijodi nul akewivcek hih nagfolaf bic tojsulum nu ciz kicleh. Zid woclet tokjek segu winkesu otududlu roc pedca koldoj zipbud papoeso dokbagki movpun ifuge. Nemi zaw oje paz nik laleg netepa weage cubleh ogfa ziz elooleowe cakaf torkon ruj cul. Tesu vicheala muka hag maseftem zeuf sohbos albuhfu orhe sevavin per obfof wurpuwego ifouf uskazjas ken fuic zowwu.','http://mibicas.io/nare','http://naz.gov/lejon','Ukifuv ga suzfe mochatub gergow iz dijo ivu rig go lilan acidu. Masupwuj zejujo dumos rec towlonvub ar golhood at wes inbato ujihu opuwi. Ukabeh nooh tizulik ame kipureg ki zonolbav ijwe vah iniri baase efa me me de mo fizpaf ja.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(44,'group','Pojmiges kopas dezulowe kibpagpu roaluup','noco','fo@ojumabet.gov','(687) 400-8822','(557) 873-9007','so.co.uk',8,'/assets/organizations/5.jpg',7430,'Wih zalmoj davlihen hep honzef omarjo vaji wufive cavikup imu edu emmuj ufigeda revum lori ufo. Nu jaarana joetpe luocdik midatopu sotvud pehwo amado nasovef keocitab noipke azjopum ilila ihobulkef di kigokomug rudaim zemija. Bato ocvetra vijik sehope alponbad zogi amricmec wisunub igwa rorfitwuc revbi he giki wunlunfob dum. Unizuvjen vajcodub obmataj adhus ohedescop sefaragoh jibonko pid gu zeav hu ho sodril obcuf esulo nersoha za li. Potjotvaw mazaru do ke pu mus hamzucsa diepo de lionosi peonu mugrebip neses uklokic imjumuc ted pig. Ukti lekuap onge lac vug piga man fussevrut beisbeb fi awa si giwlik ledid so cigras pupdib. Toeg beipokon tausco tiwtovuz gam jegosipe jusnu uhe zezewo zo duj do iwe.','http://rugad.gov/cav','http://ja.io/dif','Ajagevoro medzetu gahti upeweg peguses golapmic medi hemucuh huh lebhockuv umo lupo pojlutu. Mu hohnej joctew fuv misahebo dehipu cisdocu gazalihe jilzu asafeode ziuvegu be volobpu ze. Bo ceso sah vohpuna pusif zeafo sovi jihijlef zat musuh jab jako. Seuhebi ugipuhla bewjewul arcozpo hi zot daf kotoig fiim ti sub mivkeno rivcu fanu upikefek neglecit at.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(45,'school','Butmi alagagmud zib zaabape zaf leswaka ','zamew','re@tod.net','(325) 610-3419','(881) 300-2822','hem.io',9,'/assets/organizations/8.jpg',6997,'Ez valepse givullu nooneji gerkutiv eg lo juhotok asek raframe mirgo ipoce wetatgi hig pac pez. Tocivho pep nowodac wamad riiwo femzetge upanom zeprew heuluanu gilgejded vaes kapukhut kohnogotu. Adikinemo tisnim bobo vu wacho fuwuupa tu fapovasoz halsaneb civ kiv urzib bujiv gek. Uba bekaki lek hibis gacedu ukujeuka uj digehuwe hohzuhar solruhpe dizfimo lugutnus vikwus vozi.','http://mica.gov/ro','http://gujiid.org/daze','Jemhabwi uro den wed gobuj ofcik acmellan jacsebcol sibji igsa geaf fadi aconeoze. Ukitozeba feezejad feor fovor de gupid wehmu gujusibof ke liken tote jemat epumafo peb kucpasbo lu. Hu pozo kocul vupi kod lahatli nog mun zi neejamez ronsicet si bauvupe mo los uvahuz lip kiz. Fotkuuj pa fowiaf bejol dov os feva nora fow ho wovuf wibi pijolejo wo ochepa dajanhit.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(46,'group','Gi lu pajmic ajevaf ongar vodemme gecoes','aku','hud@reproraj.com','(727) 268-5888','(828) 655-2309','bekaz.co.uk',51,'/assets/organizations/1.jpg',4513,'Wip dolafre egiti fuw cejdasto cu fionajo toprowhe ki cew kuencez po. Cuhodhih tadpa opces negusgim fusha ritmagmok rowinpi lad de num isajafad vanehcuv burimena sittezluc. Ti mogod amumefek efovara waze hibes vagfid lalhe ictug hecaz nuwfuw bajned nuzuf hor zevotfa kag ek. Monmacat alnaci parike ledunu terpo ci zu jugnipbus dodho kolmigim wadvug ukuwij. Unedo kocke zuruf sato aca kuszid veozhed ik uwowekec inagowaco ruw korvehom ezo zumuckak jal zeetiel walusu ewoman. Liccet milbo pidgoraz juawi gi wiahi bor peobgiv es talrarfec fujgepub umauj puldizna topa tehogob.','http://dan.org/potupgo','http://riete.net/lisbu','Ofmuahi ze rikevnoz sonere ahege lo pode goedbuf cewi hadhoflew ah jawjoma bobuhep puswovmaj. Bekagi vowuzkoz aku lobnujdi afnuret tad tevpeja lug mucaguni totafuvu kiw azjar iv. Ini weofnes ron fow labemhu peap tud jed gan anekavo gum orisaku naatwe azi vasolni ji poc. Harim ibsum lo izba daso roazi jif cedof gupfu semzi boaravo ji.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(47,'group','Riwosok sub guk vutvela nipuwaj ewlus ed','eje','vehodso@seccompu.com','(536) 390-5911','(542) 701-7470','ot.co.uk',37,'/assets/organizations/10.jpg',8035,'Bonivi wulwogwi hahfus vaprol ge suden moto ca dow vuvri ro soculi wen waha. Adaufioci com zu hare li nev fopi ihotatton kotvab askanwi ok mipas zutpu olzurtuh miruli ceico vih no. Kousuci babmib ofa se wonose narsaz vavpo nadacpe sumuv rohidaok vudfu sulikpe izfapfos. Ehokakna hi loso cowtoiru sotuve cuhpipip mi nonjuz ovoosidu limubmi rug gof eb wanwi zev oh cod te. Sunlo kakde bug putum lugduc pig te ehuos us ici jorlocsig el. Azo nucev udrit lozco tuacewoh cagtokiw virog azaha alcowmuf zosnudwov cawoc re afuefioh wije fi.','http://owvejpak.gov/icde','http://hu.org/sarici','Zi makeh hacil rihcilzut geovaira fim bewijupa lugka noge ma asowalov largenub wu comkez jagvujge. Sad kedidpiw ditve pulejan eghoz woiki fu ohhibco iti fublufe ana bacasa. Doem ifnuaw tozraoto vifpa dovim atwe uba wiz pelrifa mev sumpa cu okfa endopon. Guhemih ulome na ji caneer fimu ofemuaba befofsu ladugin kihved nara vumuic givmu adufut wa. Ujrakak mus palu nizuvo elopiug huro irizin awzibik pimcanul mabtoc ja dedbisgub bilcehhut levjed mo girgitato jek. Isvecfo ranat zicufmem diw ranobsi siob hepmav ti dunininu silfe ajjij nol. Bejvaw igeoz uchecov od obapuzin wi uw vujtaok jejfu leppi gegjunag ada ehdi.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(48,'government','Owvev suh ge zebepam daktop wuolwek uman','nucda','olepom@nus.edu','(749) 368-5150','(752) 324-9359','rokoz.org',94,'/assets/organizations/10.jpg',7036,'Gugu ufa sib posrag um koh ved kiwmit laituif ja nu hun ajonapa vuzle vum hekal vusonij. Woporjo piajruz duziz ukejkab obro rukalda ed ig ifajudeg duapiraz mi itogod. Ezabizita hun jur ce kuhituj gup dabo pup latuz vivikrop kum vut. Rocwe ita ba ajvara ma hul ole bevuh tufva giaj lera paw fusta po. Mi werso eg saj cujal nibun kec neajsun saha ikaarobak vukmebun utub. Anduvdek riralu iz vihbood ko bor gazdatwof hatdapej sagutiopa firahek abemuz ilwevuz ipija ifobufwoc ac pi. Oszem tigkahmo gopjuj ilkev zofgub pur veidsev tedwibham lakujiz zadwi jeg imicadam rozosdiv narubruw gecuklez pasu zizow vezzun.','http://zodbom.gov/iso','http://visgezeb.edu/sa','Pecob lutewok veri jazfeva ma remul wimwi kiukeajo hajaz ow ef kibuh we cordos pa rehminuh sake. Gi if nebofij bevme waz colunedo vibitni zorolabe kin guwi fesrojwo ru zosburo. Ladajmic wiiti woovo kimobu suaruro mu zu zagesli cuzpil kesbaki witzumbi wuj al. Jujcis iku ematok jin teno fagoj woszesid supevi ubca secalu alpid mukzobubu guplu tek.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(49,'school','Difropga ahagu jilap vajab imriom befcek','oc','welko@buzposu.edu','(553) 209-2717','(476) 559-3059','jittoloma.org',12,'/assets/organizations/10.jpg',3395,'Udasewpal ufoabi rofeud bu oveko dopcuvulo awu arfemgud worziteta uk fem mu wiza tepuhpa mapici miraw at. Eta josniri si tudiszo ara ni nulkufoz lij so ecajuemo afce pido hagadet wow vo. Araf guc zaat wutawa ejupahuz wup setteuv zev ve vurok bugam bu tologfut sak fe rasaga kopusit kubda.','http://nevsafgok.io/dujbo','http://tutbaik.gov/budo','Nugo pab lef jag wes obaafe puh hi cieve mopsouf ijakam dopkof. Sok ga zowohsi zavime be sif sun rehre cub kag eka ezosivfu oj. Liv kip hidhufjar nif bebsapav tenpam lelabut dekewvul oraecipu ju carpebus bip pudnufe sa lakaretu rab rewolre jod. Wodaam velfov duh garkibu mej os ap pi je zuguk ma acepin vajuat todju ga ha othitlov buazo. Cezobaza gonzaom latma la gocgeko re cojaz wemhiv bizhojzus hafepam vitu viljud honi izhatvuv cizcazso novi usikuh. Odikus ejusjoz jeh kofolla wosolo kukunic wabastow isomov fub foma zip regipupe ih nahi utu be.','2015-10-04 20:58:42','2015-10-04 20:58:42'),
	(50,'group','Kifnu pe nocur rukosamu niicwor ke matma','se','ciewre@opmi.co.uk','(481) 520-9120','(861) 256-5287','zekudada.io',69,'/assets/organizations/8.jpg',4971,'Mojhu bonogako jiviwu val ho guscalap zuc bapko cordopdo inmein vukpav pawdid uzipec jog turud himgecik rameg zud. Wi citgu cab jod gemo rid dujel unbacha pij semalli fir wizoziiv. Sel nov ico lucube uvuotjub girositu obasotruc odkek citejal tet nac arzefcar da hi iwhaklu pellapal. Gujoheb riswum ekogewa obegi pev seg tilsijo duk catuizo lugrin ni iwire udzike mujiid so ufwavat um jaraj.','http://hihahu.org/geroskep','http://vutkuspo.edu/wotez','Podopuj hen zodwoke kiwozaw ka micna hi ivausev we wuromle ata ipeh nebi liaz iri pegfaw uge tewpa. Osilobke vepi fedu duwneg lewedsid ca gohturuz no wel ku malodha luipa. Tosol ocbesil tus lat jeleteocu vude gok guupu pibe asriazu hujib jugpenjic aljet gadtefduh huni ih asvuhdac kuv. Tuga razci funuc ladhadbu nugi najag irfefud fovdoj tiheharaw esi agezubej jisosaru udbumnuk ebibce modladzi bac lafutek. Esu merje ze sik sahel nabgov lehajaga dew tatge losubja fowilu defahuf ehutju cohnezzah miwbipfa zaz soc.','2015-10-04 20:58:42','2015-10-04 20:58:42');
