	(44,NULL,'private','belief','Oge zulhum are nodi ked rir hiir hajid vavo buhi firfardej oz ritfo pum sujmirap do losi.','kavsok','Ama teh abkubna lotakla bulakev lipa salfise fa huz ma bervum rodrut siklaj jow bacidlal. Olletdu cuvajpa mokbebnum vag nezguwu puzgaov zena guj da kihe ka socaugo hocvo. Sapluwe nul fa erpire obafar apouvije wu pagon waje jazco gi imubac bewir ebohowug vahleega ecirom. Dur ced tinor ju kalhe jacu ni igaponap upaza genocjam wafozap vaf obu.','local','78045','Adrian Perry','cecunu;jitagkon;sij;dofen;dozbip','2038-01-16 12:49:13','Zuki Street Kejdemij TN 57621',476,45114,4540,71,60,13.1163,-108.191,'2015-10-04 20:59:04','2015-10-04 20:59:04',104),
	(45,NULL,'members','belief','Ri wunisug baj jis hiwfuowe leeswi uce cudpevset ecuso woogi majicsoc hobgo kiowder luhok vu ma uridab.','amosa','Emerucov beg afjiwso fizavne tous nedisa ra navdiato tave ful vulokdi befcac tuhviwama binut huknavih. Nerekweb cetan afidi ap gunzovur be codahar potuvlof pa idejo paimsuj ani dag. Kuc ufizaceh rothuki gap vivkov kingeahe lunbu ohwi picuec bowar ag jowonjow. Vigwelep enamumada utiviw cowkipok urkufra narijudu mohjicev mo wonca jogu wood guiro utumon lugmi. Sutmeca bizpuz unbud hul newegvo jiekino seku ganvodcod ni nembo vipato zis es pibozas ruhe.','state','00598','Daniel George','asuepjep;vubzaab;viwuctam','2084-07-15 19:02:38','Hadu Road Torkustim IA 90505',208,23650,7959,89,79,-85.0617,-78.2533,'2015-10-04 20:59:04','2015-10-04 20:59:04',200),
	(46,NULL,'members','quote','Gilu tikem er weefa nib vec fifugu piofo zotkalkoh evoma cepmolzu elwentit iba ommug hefe warokoade cizofbe noagudoh.','ekesidi','Jefutkuz kintu mi bitus lo savot lobug puneh kumucle pegi lauve licinsuh. Eghoj focewemuz nuh dugubomi ez kihpeefo jetivi eruhehi delo fedro wease ramu luw tega. Feco ke he rud daj wilirtut tohime law ihe pe fefejidi zuanu evwiniz gidsuk na. Saj bake zelwid wijesir nujeronej adodipwuh liugugep depuwvif gesuj feevekaz nizvu to vop serjiib wohra. Haja uldo az ar vu tu jez manhub wulkup repamo fa dewezofi izoneveba ekhutaf hiba ugako rof.','county','11394','Claudia Simon','oz;abubib;ah','2065-11-07 19:14:47','Icsu Park Lodhahob FL 74091',386,17511,7413,73,34,-82.1723,-44.9707,'2015-10-04 20:59:04','2015-10-04 20:59:04',16),
	(47,NULL,'members','debate','Ohoug iwnuvib hu zow vunjej lanijho im wutzeh tigamo mev vesfa dawi rovezed ub tiv.','vadfuiz','Vidbikuv pu zu me ke gel hetija zuhodde ihji wekihkip mubufhu ejagu kid kace edmav terjir fukatiz. Ek og vudmec ra gi honbihkap dabad naip nekipem fufrada fi zi wukumfi sun zijkut makvegve jek. Pob gid wukirros fohuliw ta me girefet ge ce zi ed avife ewwomvod wuz gicton lecvokoz lus igheraj. Ililu tawgaw wu uwuva si eroeguma lij imhubu vejizepap ra oved bosku evonot pij va kowsebju. Uda alu jaesujo kiwojjot ahoupucet fitobbi sizi iz ni idka tu toifcu wazeufi.','local','66193','Kevin Spencer','zalwecok;gezfu;lib;wadriz;dowak;sogu;ela','2061-10-05 10:16:06','Pirak Lane Weszurat RI 42950',685,78691,8664,64,1,45.7749,97.9462,'2015-10-04 20:59:04','2015-10-04 20:59:04',117),
	(48,NULL,'public','belief','Obifagto dale musli gonkutkap lijbaeg boozosu umbe te peoz jefzi jamhel ecaza kocsi panag lubem cesimo hetno.','junon','Colki ulwa covnuz ad vukcusod puw fafre bopaura vop iz simelbas naspiva ba hali fowemi tu gopimoz rucoh. Ijpore idpam vi bo nicdelefu ek vib wegat heli otgo pujwe lilicami hudaprih va pe. Pun erioji lifrunram desivukut ozo mohekvu lothuhbi jovfeuwa ujawopmi codwinu dic gesfowa din et. Zopenleb uthej zof zonitgu ekajuli nuehenam wopifvi hawjuf rilekbuw nut eg issirdam utudubim pa wuninpel. Wa fefihpo zukbobkiz ujoficlu icizutod gadorilaz pab puovuawo hec lomtethe bu ol tuhah kiphit keek guz. Nu jub fowjuvse fan egace iztod fuapopud lucot toh mimma jimi dolu ocgecca fafgif dik af za.','local','03480','Jessie Morris','cen;ve;gav;neawwat;togfonjag;namo;kerug','2059-12-27 09:55:37','Rafi Extension Evmeta OK 16054',492,47032,9999,33,99,-63.1907,-119.486,'2015-10-04 20:59:04','2015-10-04 20:59:04',185),
	(49,NULL,'members','question','Nohecij ke ne nitlagak aspeka osonuve tuvro gazizbad ba ma dupkale ge ukaguw ses duckurva uz rob poam.','ugsi','Gu zi necnaf sajoaju ode nus tenu agielcog hifbo vecpozub egesiret reg ve veg fepserit sifje fujjid vufvubev. Dotos pic bos arzazfas aku bupaz agric nuuzapim sihjop heufe pi ovoej mafu rokwi. Wuwodlu fugrotka zipufes ban wi pus zep irab fez fe zibpavsoc sepuzivu.','national','83843','Eula Turner','nebel;poskadwo;dololat','2040-07-10 11:56:22','Ruhgo Park Lukbafi CA 39431',951,60777,4764,81,74,24.1649,167.842,'2015-10-04 20:59:04','2015-10-04 20:59:04',192),
	(50,30,'private','quote','Dim odovaga sovu tunhenana noczirwor fovce odeva mi meew sij vocbu jugjup ba hetigba gubivji mebdo wuog irsel.','libadrol','Oj huwef fulgiuke von ukitogup esafa go ogesawaz jicmizjop taris wejihfan cu faet. Wovuzoj siwvefev sisga tokgota san lokkubef ruk me zu azra og osulo ala. Etcu kietvo hoocoeb hekcoz poov ratbezes nekemiju iriho apuvtif du efose gijiz orukoijo sowcuce keccu wetzaev regvog hodneeri.','state','51796','Lulu Bush','tu;pinpu;ne;evvulak','2089-05-10 10:27:03','Tefof Loop Taznabe VT 08149',745,33292,3180,79,51,37.3092,-77.9411,'2015-10-04 20:59:04','2015-10-04 20:59:04',46),
	(51,NULL,'members','question','Fazu gatis tud odusokewu tu ba em delvo tazketij niketru sulkagig ahdaz uco bolwa.','hedtes','Min haw palusgag avi pug bimfipsof kekhicti fadafa omo ze gusernir kuplo mah jizbeffo bid vifdaddo ligafen fiticsi. Fijdodu bizebet elmej tijceha vijna isa ves dokoic be opiok ar zahani co. Howula ecjafej abo ne tefaw mucbukci ewjo ne nanuovu zaz wol uzamji soz.','national','76184','Jordan Lane','uzza;gudwa;pujalu;te;hiewzet','2078-10-02 09:10:39','Erzon Square Tosruzvi NY 90746',186,4340,7616,67,96,-62.6773,76.8359,'2015-10-04 20:59:04','2015-10-04 20:59:04',174),
	(52,NULL,'public','quote','Ijean idsunze kudko isa oscosam ho emepopba itovu adegen gumpezi ob mewolo pizhos wisubu bedvor bo cuwcato caawhu.','secilew','Igdadi ugececuv uruceba uwe hajac ati razma ib renrew ilwi ze wuj jufvodsem fe osezufe gipmed. Roro no honfigor wasad ihiak zan vapcud wopmubpow jowa fu tic cu. Wiwod tazpuban evehuw ucreatu bavhozgib ufujo ituake zuowaka vat ehcos uvfi vocuih tase. He ovetoosu feam gotjuf dofit re cov to gajeowi palud bucsi meg ruzove. Lumew pawak octaw inzukoz zizegpub nem ukatojzip je puebici iv lemisi velifrak nuw kugvo hapu. Bimrihjo nepihetu ka bopumob du hog rabtuzhe bat ot babopo nol vepeszo oci be. Lupisu wowsawbut kimef genaj nisjuc muh tehi itfo fom ropup wodna fi lodej iloez delgasive povjeoha vanvilsis.','national','99032','Connor Bennett','digiosa;fupta;kauzvuv;lu;lo;komfi;zi','2110-07-18 19:07:47','Lapre Turnpike Purewe NY 14108',23,75626,6979,75,50,-33.7797,-34.8768,'2015-10-04 20:59:04','2015-10-04 20:59:04',181),
	(53,NULL,'members','quote','Gi mapro de dih ker rignawik delegol so papephu ta imadi ji omuvihi.','vorwo','Amjij monboko hihzevmi efuci mi uwkodve hafir muj bonecuk kavvo hezuhpa vaspoze edu jakat rubopu wacioza. Maucdi agros odku ow nihuj nirgu powdu tebeb mocew aktem finwa cufezoba picun. Jipne eladagsaj norobpa pijokil kavalu lafoz la juzev ci daziwru nuvohzu peg su fow. Bu obvovub su ze dugtazol ni ejsowlu nuwurac besik immefnef agalow wufsizzup or volal idureiko aso. Nujuk vudbekwi nuw pudri za cionnef hulbapnu fu sidfi dek pecij zil ekjemah iza apu luffazfo fej.','national','09163','Marcus Hayes','gedpivve;gamfot;muan;uja;malpev;lisru;ridi','2038-04-06 16:38:37','Also Pass Figoju TX 29298',716,96037,7277,20,55,-51.7786,-28.7632,'2015-10-04 20:59:04','2015-10-04 20:59:04',4),
	(54,NULL,'private','debate','Muv tepgi uppowses amribi wun riwif hizke ro etbuhhet cog seojucis ne cu lemjo ro jioj nibum efa.','arki','Kitomza eni wulis wa did netlafvu netahzec redveufa nipo wi pulzur vadkina. Zesanme cihunpa fuf du ili ja ud wiw medijec kavuj mipno tuzjodu rimehil enuhewev. Pu vuekeow nu josdi su gef zoznupham abbiklu azabuzba ewevuag sal geca dunahe pow. Bilew wegafiuk lolgek muusjog vein do tegaop zeruwhij genval respoh fi ep usbopom zugordo.','national','90903','Edwin Jensen','pitnov;soclaw;su;nefrir','2067-11-19 15:47:41','Gidza Pike Afvoef MS 65427',634,55110,2920,17,52,-83.6017,72.0277,'2015-10-04 20:59:04','2015-10-04 20:59:04',93),
	(55,33,'members','event','Gi pa makhefru pegfoso uc parzec kanali isroze ikucofsiv borelwo vagvowev oju zitim peuliun.','sov','Sa agicuwke ruwzipga wam lezo deolonu te topzunu foeci rabito jugado lot kacuc wilimevo wibiej ivakuevi. Jewci mulcofuco horo maf anjure ir owkenuwa ku ideizausu gusi lehwajto jilofmo opanome kajvez. Av sifip paloladob reoskik afosavwo isisedhos nufecahi moce katacet fi ipuraofe le gu aw cegog eklakak mehcor. Awupi ujoneve turjudpoj zat ca wo wurif oniuli ule pu aj rirapi. Bate suzzewru ikbol ip zomij afni koewdiv ogzevu gow latouf av orper zed. Ruj fef fuk hac zi hewwizwov ifibotnob jukewos ikifa ipodom evevac hipo vu dimhaduv kihwug damor ipa mi. Caap cuguuk upnugur ipuuza nujah lucar ogizuta ew sipas ce ludwihke daboobu.','national','41792','Rodney Briggs','ub;zaugdi;fucemtuv;no;asus;uleob;fukupga','2066-09-17 12:55:35','Ukvah Loop Dapehe MA 37631',110,1183,9459,34,64,56.9548,-95.2122,'2015-10-04 20:59:04','2015-10-04 20:59:04',21),
	(56,14,'members','question','Menage zazsi imi vapaghis hatipcug he jogka gutdah ma bibjufano gumalsig nefle uwu.','fur','Hezsaru rovhudhul otu tefag iftu gosuh rug wabujmo lighoh kefi fov ahtapa da cujazifim kocig. Bak umvotoj uceregek tejza ivetat foapaosi mez anaimo titiv nobninja oji guici viw vikumi heszac fajej. Tawke ape ogila cinako ve ocvunda bivvifow fojfuvgul ij ap midsadju seuhlur. Paumame sih ram wik daekbib ironu tuaddil bova jeog kercaju torur safweju gipi uliiju muterled bo muavluc fipej. No wic tinhafin bak jebgovi tu wasipu henaim udodi uhwilwis wefala wukci kug uvejusuh. Feoge mi cemufe uk bih hudupik ji dav lautoehe zuzbo jiveguf rin se faisuziv os mejma topcomciw otoojo. Niwewnu davida ti ehoza manmon rawnaota ce be pubuwe jo ob sifuho ge duvotoz zozewi esjabsoz aku cunu.','national','48750','Daisy Garrett','lotnajna;rezot;civifruw;ogotiz;nu;ihnowe','2063-12-16 09:39:53','Gohte River Cagiwar SD 51336',325,69070,784,39,73,-63.2825,-179.077,'2015-10-04 20:59:04','2015-10-04 20:59:04',42),
