	(60,NULL,'public','question','Uvocubo ziuda berfe fenlaeri kacse wekotaku jedubwot cuvzudi ehi juhil vig dowuvu epkig.','vavofaf','Cedguh dim wuvlizluh cafgupos wut afmaz re biv ijevihar imeri oho rejheg aduema bugepar viza vu uplemod kajuk. Areso bof fim ni bece vememi lineb asenuv imda hul ewdedih nenzucum andodi jov depfi. Huzun woplisut kun lelij vuwtuzeb iju domij ba car wa kigozu ebol di afjim il. Ulre itwam enzep oju vubozjoz pa vadufnam ni jo mujziki lurhones wom owodiri alsohov. Cegu hep webaure tigjej pozgubok muggu wazokher pun zikwoji rufgohav accep nuvpu nik. Oz duviscec dug ezo urufep vu zubheddam ikusi mug faurabos bij jof ta poinu tigof ca. Ila ekihep safi defgir benunu nuhgekcol no mu ajsuw vivduksev ni sajo.','state','05838','Philip White','kojrulhu;mewhi;hurce;nevwo;hosru;ha','2092-11-23 15:10:03','Zowuj Circle Jawupti CA 31092',742,21957,9709,62,47,-25.6387,87.0327,'2015-10-04 20:59:04','2015-10-04 20:59:04',106),
