	(68,NULL,'private','quote','Diedu neto rukwijben obtuh ej suksiprar agike wum ha pucozma zup rid ru huvut.','amupijji','Ejaguvo juhid cusa degova keecezo ire icifu ihatiwo lag reku fonarho cohewa fezlufef hibfem mocunsi. As mi ew uha ipce sewpup feiwoki devsel solwaw hizavku mocotzo deej. Det wuaknus teipde ohlif ozu jidog ucamew rin ardu vaznid nocer hikiohe fagifif levsaw taiwe. Narjilja necemipug vek ma goefana lipediaje edesablid reomigab gubano we hifwakeh jejoh ce nadudu atu. Igakazu veel acumepu timzivol pu ib saulazob nufifuv siblavuk jecij az mefilru zer bake. Ulecu jeefoki vulzidu gephe siazuehe omipag sa ewvehvi put ihroeg sosu iwo cidhanah vu kupgadoh aj ukoeli. Cazol wi agu ci bim ro fac jomasel tavip nuljugsa uvpaev hevzuf bod rezgevi nagdil eroj lenago irrapluk.','state','37149','Katherine Carpenter','hez;kehofad;catos;mivoh;tame;ijibiuh','2104-10-13 17:13:51','Buzo Pass Ohmepa NM 71956',652,88124,5692,56,1,76.2919,-45.5415,'2015-10-04 20:59:04','2015-10-04 20:59:04',20),
	(69,NULL,'private','event','Jajo aho ibuk ruskedu nofagu itiop rioda wuapnan deotepe uv hi vog penuta revo.','cefej','Hotot buje bodku udoto beso galawmot vufpofra unu hisiwne nainmu ohulo bi gozkebug ceku be wagonasi. Omi nu rav ciug fisa ez eddun rah uhwuz gu zagzu pijeho nug nadwufdo noj sasuzeruf rensadlu des. Kakar daj wecarad kegocfa vedije vojiuti lu dadu ni nufi gowoabi ceutwub owiej izisepum fazur iruoraira cawri wuib. Junep bihzabte efe gonubta dum cidnum tup cackub nuwupom de ral tulag. Lihirwi tivwowhaw jubbof armion butup ik tugipu ovemeka ce cawvafbek afe zanap fib up de daw. Gapfaco gisupac javunmug fade wez suw baniw ulapeotu nic latatca cokap siz doruf waowo mal huat. Kogrudmew fief iweja fo nerrita top ip etez wej jakgadve upevu map maahi.','state','11424','Mamie Gill','opepebdun;ciadawo;gu;bu;egen;martozdul','2038-11-06 08:38:22','Rufbo Avenue Goazeog MS 83895',717,64484,2622,68,10,15.4286,-134.908,'2015-10-04 20:59:04','2015-10-04 20:59:04',45),
