	(108,NULL,'private','belief','Eco sofobal nu rode corvehu rozjo dahpu evuogu hab fo vupoz gak wepisze unuto jeg ka heh.','hu','Pop bi vehe poopimuz orwol recajitu digzapat vunu fuhe fotu ko zak datti lez apu wa geb olipif. Mifwonom ujamek ze ju vur lipuzef wa oj bepenip kenle fip owifa mo vifmav. Pejtu tajlitso hogtor unnac hupnutno wistaak utone rimes ra vibeb kapinavol zihu arpomis zugegma gijad ma piz. Li rib zot guzissop ih ohu migu poreiw pabha ajukamu cofe jeniteg uz dur vusjaziko vecdif jinmocas ub. Oma uz odivav zerer cehfe ezluage dip rozgol ozi mobsivim cupkonu necu fa poj ohu.','state','50366','Delia Vega','cawohi;tebimev;apaelbu','2047-12-04 19:52:26','Osnor Center Muzdokru NH 11098',873,59238,7749,7,15,-7.78187,147.086,'2015-10-04 20:59:04','2015-10-04 20:59:04',38),
