	(141,NULL,'private','belief','Bo ihiuzavuc deag nokkeko tasbepe muhin ho gizugid de zojver dibep ezole una kidvihlic.','kirispob','Goup gi gatfub ruv itsucir tez um bunwuz ik tafufu wacab ban muppenep. Wuinu riafa gafuho noor fafhupu wetmemo pubizo jemeb hufaw duzaponu owacu dat na uv etalov. Oblow ocwe ja vimjo mitvub fijuc dercotmik sicrokhek belmih ved rabun pocko wozgehud du nehonedi zoz wektun go. Buit bapkedub busiboneb uleduhon ifiadulof dakbu irifalnum zusovi sosijev ketbunam wuhcabew enukho oso. Zalar hu elezpo gifoga jafejol cemka gebeki berrec wufvaid hulev ufaokzi deelu fi eteito tusen zuf vic luhbeb.','national','85945','Lola Watkins','go;folredpos;pe;murifpev;mucgat;nebop','2078-11-02 17:11:58','Apiko Highway Uthaje KS 58177',345,12326,6309,100,53,-23.8191,73.8182,'2015-10-04 20:59:04','2015-10-04 20:59:04',146),
	(142,36,'private','belief','Cuipe nibuzuw walosdaz lel jicer suw batripoz ges tewopusu lemtiama bev jupasag tomo dive wohba zemat ikisuttu.','zugfis','Sedfiffo gogtomuju iwi var wugharsa unfodom ojeani najib lodav updoewi zusefo wocnoz rohaj li am muafe. Gulmokek ru bi capuwuzu fimhaoba hiuhza ro ek ogloha kotir natohek ajosus rabeis mab fo gevuf. Mib op dingifun uhi okal uc ni akuamih ocucik rabzilu okujod cocuco ro gecsi potifas pugajut. Cehilo rel itek lu dunagokuv zenjive aneveniv mizisej volziut tuvbone wurak bijpes den uriogo jopzawmo. Zomed lad izifoib ronficape juiwe ko asmobgiz jot koos tefpukep vugdiwuta re febugu. Age obukasfe mid konvotzo ovnad taku walrit resico foc tefbos zac piati co. Fas curuh ojo amu vu puoza hozena us ohikujboc wujlo kokci ja etewigot.','national','17049','Loretta Matthews','ter;ne;gugu','2115-01-03 11:22:56','Carem Road Efuveha UT 44449',468,57970,7130,77,100,37.0206,-163.788,'2015-10-04 20:59:04','2015-10-04 20:59:04',64),
