	(144,10,'public','question','Fumubuj awvob filgu we kalo vak izkaduha depoful ugumuwmej koowi tamhuto motfuh lu faz pazohbak.','suovaku','Co jarwuv ofu ozeju deoge lanme zahmu ihumej cirlat wez nidi hugsa amtuget eso tu dobgawu gasujvig. Gertoeco wiv leiz obegaho eli pi deppa osaw mifumwab bonozuz ret ba cek cajo jigijem. Zihvu ipo kowfan hilizeh otali jebiz caazze atfede rusdodtiv guvaso wem onahaj nigmu cootuca low fa saih ovu. Mu gifemfif bo vehic bugdew vorhaj adzopdic vo fiisufu it siko ogafup urula ru.','national','14451','Bryan Holmes','wowola;bim;ko;fimfita','2056-03-24 09:21:11','Tija Plaza Vucpahoc NJ 54076',158,5963,7131,20,13,-10.8776,54.8074,'2015-10-04 20:59:04','2015-10-04 20:59:04',114),
	(145,2,'public','blog','Mewwuc faba soccarij guloceta tib ruklocaje roek oceavefop hol gat mahbumor lun.','uciveb','Tok wijeke situlebo pahig laj wufev ehaus pipigare mesuhog hi zu vafim. Amni uwefobam afo zomcewuw wuojmo uzuduna jofaro wasfac gimduget cifip fuhleh zo. Zosuf laajeaje woiw coravo jen henso muchi vez vi nu nefewkeg uwurodak pivpatgi. Cup we wiw vub vapsi nehme ri pu dinrenfe uzosi vefti jo tiisaehe octejha epodojje fijuva odler. Ascaaj kajufavo vobve udajetpa tidvuh div kivew hurur ge gi igelel gunaca hu gojodul uvkujmug cajon vubabo lukaf.','county','33389','Joshua Phelps','va;ho;za;ojaza;car;gunafsav','2071-07-16 13:14:35','Gelfub Manor Jeogumut LA 03716',585,56497,1802,13,45,14.0029,55.9917,'2015-10-04 20:59:04','2015-10-04 20:59:04',121),
