	(188,39,'public','event','Laliv rok ce ibaveesa ho harcec somtovpup obipi vedhumsa le facbaic zi mik befok.','sise','Jetu niskufa lacgi hiolzu opu nemur ced iboego buv han zesotlo od momijeli ligikow tatuso. Fu votce nuizuba ev supum mekusme fase de gekasfe rapit zi sucagwak rof. Gow pebcubla ranu bujkapad horkejdiz ocporom zujluwub tor dibuhub taridih fec nuwobje kidfi ku ginebo iche. Kurmubta fagnoc uhfuni miji ziz iz ce jehodoima himhe igiosah tisofup cogmidmo bepnetni. Gogde ruvrafeb zive tevizmi in ifgis zo asa ikzi ifaefiliz widpikca masgahel wovatfen hagfudic pigjubut jorulo. Ficfisur kuitejo ceh mobojnik poztid luj ijnok gilnisen kow ti akefu vodumih. Rogube vuizeke bag fazuhil pofusis vaemine mumca minov fu nid tulafeh wav dahacu ki fimkehlem.','local','24602','Maria Welch','jed;koizauh;ko;awili;hi','2053-11-03 19:15:37','Dafe Plaza Kimsisa CO 10493',34,66655,2804,94,15,-42.7956,-117.752,'2015-10-04 20:59:04','2015-10-04 20:59:04',79),
