	(303,25,'public','subject','Kolubmul facvejanu ropbed bufit rotij emu orbogbu gi zeojire bo kawvuf po ge azrizda.','ocgiva','Zejoira jadfip mub mani moruk ni hehkopuw du ahazuc efcev lirjuvi cunefmod fuplagji vojazeg zikgu. Cu cocjesik howzov ki cece oloneb hugu citut ge sounu fevfatve ilo doz gezo jo owunagep. Luzos tif zaj kuveeco ab fu sehle rowoloro ze hefa inmov locna. Pav mefikiab sicenilar gid do jog kahado ti vib acalahap me zuzmo vitec gaz va. Mulub tinopu ranvebus teed foh lij ce lof bur zotvabe dumefpip bi cepegiena puved pep joz. Mogfaure dijmowson jeevec afnel genhez fi asoabu uho nowu zuj rume bo sokoli. Ol si rahu tutwicdiz heptotrav eslat guzaola codiwic ujzigle ihiciro sugjuf ce.','county','29079','Ronald Carpenter','zej;uctadho;mus;juktocig;tos;uzzus','2095-07-05 11:41:18','Zoiha Loop Cotpebaz TX 51834',277,45066,4854,80,0,-60.5991,86.0186,'2015-10-04 20:59:04','2015-10-04 20:59:04',57),
