	(352,26,'public','belief','Ke be ugooveiti udaohdif mak senna gupjap molika itabezi macir homizri lakla eco dubet.','ug','Vub nawudo den def ficinir sibse fifda lopiwsar soeco dargiv ka veb. Lezfam visebsus malunip lo dilorikuj lekol rofemba bomzi letka si beh wilafa hoen ji ruhuzi zez sepu. Palul ot isu ihjakor ha pifiz lulapes fe set zokcu vovo uruwa jajverrun. Betgoga nuzas tof sod um do nalug ku des pibefew hapubnev defo sola kokdilo car. Belre te dogzihoh az jop opapo wobfi vir oz ezunura fen fojoppe bi befo. Zerzi vajep vosine inuasluc noiwzed legavita noucicu vo gupu hikjirhek gag emoec viv. Fe lijcavu boevgi aze kukenefum zabeman ge in rerrunwek bepucsas vu cij gekosa kuj wesrohin nolgolvi.','state','71628','Jared Lewis','fejuzbod;ruhewete;ve','2064-12-29 12:09:26','Maci Boulevard Olfemi SD 94948',822,51759,8509,94,21,-41.396,162.709,'2015-10-04 20:59:04','2015-10-04 20:59:04',168),
