	(382,NULL,'private','question','Awekuusi vude izabiiba kok jicpah luin zav ju kezvuf va jickeer vo rul av potora.','big','Uhfafog hep gepeg pozuwro zagajmiz re ganmesa vuazge uloged saguz riwub ji dutsuja jetoco lehza. Uwuciji bup kaja selame ib lutjepiw bosoguapo pecti afo nij hegovuk fa ruis hag oja tetes wu voow. Cadzullil raurujiz vewzupu reiwnu dohnumwij gon okuata ur lotubwu firiwes si ro ivhom gub joz on seshi izowaj.','international','35345','Lucile Carlson','peilukan;zawida;hejiwbo','2065-12-01 09:26:29','Tojli Drive Guwfegova NV 57380',360,83522,4692,73,95,-25.3927,-77.3245,'2015-10-04 20:59:04','2015-10-04 20:59:04',56),
