	(389,29,'public','quote','Jowebvuj jec sohe feskatfa lunvokho fukaljen bowun oreci du gedmidku as mi rajehjap uviag lu.','zachorfu','Nefosid ocruvac wizof taekasem wunted he jufrenu cofilbej janwis liec barozu guje ba nil tiborjo zij. Pulo zucso okizis bo jicufe uwowi tirjilop bowpoet cahoreg gepujgin caz zor riudkut ju kobwom pojokoil siziv. Wo gonogse sa fuval tub jek lazedzi ehacoz manwanu waonuduz kavfufo ta kudrohvuj hir hiv gi. Fiwde do gipel leihi udsembo to vuzat abe fezoha agu genkogan reto serze witmomit visuboz idbib moned. Hu mihagen hudub ovimukaki ki basufpuz zan vubis kab bohosas himakub figvawce ame don.','international','57683','Isabelle Pierce','jite;omu;han;zupjap;ze','2085-02-06 17:15:15','Wegma Grove Wijijez SC 58396',635,79854,5653,43,72,78.8531,-3.30162,'2015-10-04 20:59:04','2015-10-04 20:59:04',15),
