	(392,40,'public','question','Pu katfon wijwidasi ra firurusi gu utiobaku bicofo ela kalonja fufigiref ban.','zik','Ufivizo suwgi pula vo he uffoci soroka bepa zu olsase tu zilepjat la tugakewu. Zugif nimjer vomnel pa cul mar jar jinu kegcef fadfabgik ubu bow waz lumfe nedaw rih nu. Ku ice gisamuz pe barom kaplez ajjufi sigok egu as dutivi vawkes gejidso cuvodit bo. Gi vahuhi micibi fe vailo bozwa ero wirit vuekmu kujiv fi pu pow cu lasfi suvuftic.','international','97988','Nellie Phillips','zaejozod;azubuwa;ufma;cuvnuur;va;efa;ze','2101-09-15 16:08:44','Wetpam Drive Saonhid IL 04145',126,45677,138,30,37,29.0021,-81.4728,'2015-10-04 20:59:04','2015-10-04 20:59:04',39),
