	(395,36,'private','quote','Pumwanbe gadkuc ico ri vede kuosi gar lowfakcid dodbig isenuf mol zuj famaive joci.','bucupasu','Bafoef did aharughil jeve man fepgup fo zoddu jez lup itoju pun ti ho. Du pektoc uku wolzodro seohtij werar webep vo sajosli legle vosemot zen unore enidorda naica iccu mi. Wozar cefcub tassohob deul jeoga bisewna kalajo agab ansafno sovju tawosude hulhe emo zitigatoj. Cawoelo us muk gezjozo duovi roeceip tiso vovmaca rol ten ce ketzezej fefmeh ave co liosoje wiva. Ewagour fu ducep bazoken luj calavize pedcuefi seahi eg zordemo naposrar dol rovzazimu palbef sauh atuwiz magmi. Tes mete nibela fujnotfo copam ovefki sed ugze majop ohwuz fobjudu japip irfif oza ocuna zovufe icekadep tuoc. Jifjepok kuzec eholo umota tidavne nor kaffuwsoh petewra wongar efo sa eme ibtonuk to ziura.','local','33993','Tony McLaughlin','voze;nifji;hum;rewe','2060-07-18 13:25:59','Ozbi Loop Fouhodor DE 60290',450,6924,6363,76,68,-30.1777,128.599,'2015-10-04 20:59:04','2015-10-04 20:59:04',160),
