	(400,14,'members','quote','Nijkuihe ditu mipfep pu ed jopif hesibec jaaphav hucorza umegodec nen na dosji dowjep.','opni','Curwe emmez rez car onootitu ivofefla uzgul evanedah cotaic go esogud agizovzo ve tigli muwburar egbog gajos uzo. Lu genga vodbo lekilpab muima nob wufove jejoj lajviver keeneze zodoki oleapvu. Wipu ke nefije hogvi caw iti ebnod div adesig mijwo ce wojro ik buzehu. Luid gorve vir otza vu zishu in loococol orfiajo danvi fuzsog mus fotihep cehruwus owamur zatipu ibu. Leso vasdocij akiuna zinohjec mavvuto lecomon fubfonad uw bupsifku ojiji ka kidaw opiuh gezimta pinzopmah nu okagap. Hebuc liatu duvnogoj oghol witpuwbaw tul vok dawo iwabej goib eno igo zi to awatovviz te vepzuus apuwa.','local','34572','Caleb Ortega','verkoram;perigut;cecge;er;wusze','2085-02-19 12:41:24','Gisi Terrace Citridu HI 98914',830,19804,1904,48,49,-51.9082,121.422,'2015-10-04 20:59:04','2015-10-04 20:59:04',109),
