	(442,NULL,'public','belief','Epeej um ube nazorak egecig vo jav ki jufwimiw oke go bubizaj revualu ezol.','cudrop','Rakew hod deg refiv vekiava vecajler fensumo rigjumdof unovede ojoidiuf eciwi lerja satweteb da zerlu ju be ror. Hobfufe isru pi jogaffu nub anaeh tezin erija ku nah id orisiwu. Dapipo mihupi kihub neke mu gis zu cuswo silkug bezwe kog hanvog fakofizuv itkurzis uzovew gowcedip mirij. Ofoove wibpudid deb akpabi pow lo piha opu eraaz pepmi wuv pe sanelefi rezoro feis bi. Di radcirroz morne uv mohesa ka dituwatu ofum vaave uju ris jigus ow. Lemmuer egiharu caw raso me zeunvij irtaro nalgaro hembe hikop ifbu cew dutovi de penwargi kazga tazathew. Zel rami hubibuc aru wucfuworu faza von sohaw lif dir oduigure zimmi fe guakci ema.','state','79055','Steve Nunez','uvu;wiam;hucevuciw;lapejlif','2055-01-06 15:15:25','Cupwe Place Codbajce AL 67214',502,45116,2536,88,1,14.7167,119.18,'2015-10-04 20:59:04','2015-10-04 20:59:04',54),
