	(459,NULL,'public','quote','Vopanuuro sevleklom igepefu fa pohupta tajek rohfevoj ot luowisi go ho saenjud os pitiupe evta.','ovnopo','Ujetu dusoh wo gudleimo fir zigevpig jucru de zicroka altel isu tebibiv. Kibe tijuzmir fewenuni bemozzo alocavip zowad vektop leiw copo fi jeita idruh hid tub. Bimwuz jekih ne weevejo doj od cowteczuj sek bepmujmi zu tom kebtiz mic echoev od. Ba fiz ame rojusov sa vijdat af nabgodag ali labowli ven bonfe fa. Mo es muv sawkatzu ki kazovu lihotno oceki lageb ze tovev zurhi. Juto het om miluffot pelamup zosirrem hetermuf ansozzut kiwon un zu tusgab lov kegsok buduhi cihes natfaw. Sukne juv ripti pairowe oc cetuj ca pu eri pu ervowa sefseku kiboko ovi usapa.','national','93479','Barbara Stokes','rut;losuc;fa;icuuw;wa;get;wov','2097-04-14 12:20:48','Zeuko Ridge Ajuwehvi TX 90910',923,41940,208,56,7,74.1384,-98.6887,'2015-10-04 20:59:04','2015-10-04 20:59:04',168),
