	(464,NULL,'private','poll','Ravgufuhu lividu mirew ofonuf nin ejotadhit wophapbi uc gigehbi mec dacilge liz tepeccaw tewaje rilgunmu datilajir.','ru','Vohvohsah rigkies puzbas mej usoragor uhnos feguwot fat jicnefa up lohum mopitoc. Ubumbad fe ricevbe sodni cocoweup jati kihlenzen vejgeg ik lal ruh dopwozar vo. Hehed bemwoju ikiikuoda widi bodazmej tu we nopaco fitefbe rikso huw vekirer no fudut rougieju. Muv hivomow mopluok ub imo divup wamesaos viweek jujsuol woviazi gi kezopav jacihwo ruf raguhze.','international','32061','Lenora Norris','ecatauga;je;luz','2062-12-30 13:10:12','Soskol Glen Jethafa OR 57173',361,74018,2968,62,37,-6.45073,84.856,'2015-10-04 20:59:04','2015-10-04 20:59:04',8),
