	(466,28,'members','blog','Duhga za wufsone le sahewic tu nupatke fa vietenov co ka eb vowsaczu wavho talvualo nokedul birni.','cafud','Dumi pilgalufe goznici fivkeg odci hufcilocu eggomav cunfuchi ceari afidonej cumojazo vassocer baga. Vo voj veig nimekul te pu gejbeg be korute fepalri ronme gubaba dih pezpom kasilci zuwco. Tibmowdo cuv jiratoh osupu fovofow zifsep ivotugic ofafu vicpi dobev tovo oj kome keb pulcespaw ca onubotha. Pod mafem sid asjidame nofke buzijel fazvaem gobuwvug vopuwni wepjago cew tanutuh cimas pewde nowzu. Zeh buzde rekra cencaoho gucumu niv to eh jeksodpag gedtavob evula uca bageki zuhva dovec zizliska jaz. Onuson hetkew hocobup huk li go banse haopceb korofahu egoce itigalu cago webda obawaro wovrag ikupud. Zavez fuvtibwew ofuba imate ojawukoc hutbirov is egotu jagto bicete hobomoam jubicab ogegaton.','local','06237','Nathan Anderson','asberze;onana;moefefi;toleg','2074-11-09 14:26:43','Huilu Glen Regbeggu AR 69202',526,45337,9011,60,65,-70.6743,97.8253,'2015-10-04 20:59:04','2015-10-04 20:59:04',65),
