	(476,NULL,'private','quote','Tiri wek duup ugner jupawcan du ocufisde womo vobcajjom adebug ocutigliv vaziscol vifra topido gidtujbu.','enigu','Sobuc vuzhulopo aho poce bela mukve neffe nued vajwo jifwakko rekdakwa ob. Ro efowo kopurwet omi mipaib giwpum ene mo kuzvaina fomizwiz oj garo ha an cefwutuz pi ehur. Jilatudo ce suj gikoble fignikru jarvipzu mejbovac tibkomuzu ekakewwek bivog de kat arjughi. Keda vurcev ili neh nomleso zeb tad racegke rimuvwal cepazi bigrov cajibu apuub hoihap. Af tizhe tuzipfog atafapa on ajzep ib pinas beszebhon edbum fu fiulabi wiopade cidcofla nem foljaj nasiseje jevecnas. Os ca ked aniime padam gureic deeridub unauli mu cu rebneve wi juzibi gowed veanosok.','county','82251','James Hampton','muwlaew;el;noliju;keno;mi;si','2075-09-10 09:54:20','Tatod Boulevard Feimifa ID 62912',554,64920,5229,90,46,6.34294,178.666,'2015-10-04 20:59:04','2015-10-04 20:59:04',135),
