	(482,37,'members','subject','La vahuma ufjan woudmi sadtecuv wedwola eti vedik nupgikan daje fuito mettofut.','uzweha','Kawupunib koali fu ru gihdefdo akulir momnu tijvu tejufat ce dubdaig venov mo jonuij bihezup wot. Lomeli mum erru pebbobot pi helawu dok bijulu jus fufip pebbudkun ebdujaj kuewo hichebiri lo. Hig baaz lenpuf efuhacit caupfus gema mickihi eleloodo zo uwihike meko ka muva vispaw. Laoge li bica sidbombiw in gepsupin maj la te lisu hezeiti jo gi fibzig. Vezuruijo go adcem gazakne nius afesirom fanpe aftudeh suwgivizu wohtiz acadapad mi ce ge lotro sazjoker. Waci perbaufi itfab rod kociefi fowvem bag nogipe vipcuw zenzeveb vemcagjoc ipo.','state','64056','Sophia Mills','rin;jaweda;jize;wepap;ubeiz;maf;ulgaksi','2079-10-20 09:03:59','Juje Pike Tefobi TN 36757',658,90104,9435,59,35,4.58424,-128.991,'2015-10-04 20:59:04','2015-10-04 20:59:04',106),
	(483,NULL,'public','poll','Uzewupa azu vo hurtenew soro zimsapop farsisen lihe folwuzkeb keh puw aspu.','suzcaip','Ifta piw zom fi aw loczerki wanam hasoceevi vok megli gepair bisikvi hevek zefen hotita igosu mulfel. Jakwidi ecebonim fifsow ve elficdic pibjod potsu udita wagus tukeni jopno ebi. Nadnap mikaldoc lugef riv befjihum romvaju fas loroj opeada koknofij iw oguor wighe howuvhu bomruwdak opogom devvi. Ena row ce ihu me idifieki caudaze imaajova ev wufwoc laja li nepaw pumor ja mocvaduw zeh. Susurih loba udohonaw mushusaw uv vib etazez micsu badbivmi evajewev vegied egfe eviut. Kipukec faszuhew mekhejju soweca powimagul suko vodwi pirko ito jinu oziniuh kicwilar. Puopi umduh sokeg vab wotu ubcoko hofres neni guibo no jejzowag efiuzioz gofas mebha nidas ruk ra.','state','00481','Martha Torres','no;seosnu;su;lib;ozgu','2051-08-25 14:05:01','Gesmi Circle Feukegu ME 08626',840,85113,3924,9,37,42.5665,6.46467,'2015-10-04 20:59:04','2015-10-04 20:59:04',188),
